import React from 'react';

import Chart from './Chart';

const TickerDetail = (props) => {

    Chart.setOption({series:[{data:props.ticker.update}]})

    return (
        <div>
            <div>
                <div>
                    <Chart 
                        key={props.ticker.company}
                        data = {props.ticker.update}
                        time = {props.ticker.update_time}
                        title = {props.ticker.company}
                    />

                </div>



                <div>

                </div>

            </div>
       </div>
    );
}

export default TickerDetail;
